import React, { useState } from "react";

function InputText(prps) {
  const [value, setValue] = useState("");
  return (
    <form>
      <input
        placeholder={prps.placeholder}
        type={props.type ? props.type : ""}
        value={value}
        onChange={e => (setValue = e.target.value)}
      />
    </form>
  );
}

export default InputText();
